import { defineStore } from "pinia";
import { bufferRegister } from "@/api/function";

export const functionAuthStore = defineStore("auth", () => {
  async function bufferRegisters(id) {
    try {
      const response = await bufferRegister({ id }); // 传递正确的参数结构
      if (response.data.code === 0 && response.data.data) {
        return response.data;
      }
    } catch (error) {
      console.error("Failed to fetch point data:", error);
      throw error;
    }
  }

  return {
    bufferRegisters,
  };
});
